How to separate GraphQL schema and resolver files using Apollo?<p>I have this simple GraphQL Apollo server working when it's all within a single file, but I am having trouble getting it to work when "modularizing" the schema and resolvers to their own files.</p>

<p><code>/index.js</code></p>

<pre><code>require('dotenv').config()
const { MongoClient } = require('mongodb')
const { ApolloServer, makeExecutableSchema } = require('apollo-server')

const { Query } = require('./resolvers/Query')

// database connection
MongoClient.connect(process.env.DB_URL, {
  poolSize: 25,
  useUnifiedTopology: true,
  wtimeout: 2500
}).catch(error =&gt; {
  console.log('Error connecting to MongoDB.', error.stack)
  process.exit(1)
}).then(async client =&gt; {
  console.log(`Connected to database: ${process.env.DB_NAME}`)

  const dbConnection = client.db(process.env.DB_NAME)

  const resolvers = {
    Query
  }

  const schema = makeExecutableSchema({
    typeDefs: './schema.graphql',
    resolvers
  })

  const server = new ApolloServer({
    schema: schema
  })

  server.listen().then(({ url }) =&gt; {
    console.log(`Server ready at ${url}.`)
  })
})
</code></pre>

<p><code>/schema.graphql</code></p>

<pre><code>type CourseType {
  _id: String!
  name: String!
}

type Query {
  courseType(_id: String): CourseType
  courseTypes: [CourseType]!
}
</code></pre>

<p><code>/resolvers/Query.js</code></p>

<pre><code>const { ObjectId } = require('mongodb')

const courseTypesCollection = dbConnection.collection(process.env.DB_COLLECTION_COURSE_TYPES)

const Query = {
  courseType: async (root, { _id }) =&gt; {
    return courseTypesCollection.findOne(ObjectId(_id))
  },
  courseTypes: async () =&gt; {
    return courseTypesCollection.find({}).toArray()
  }
}

module.exports = {
  Query
}
</code></pre>

<p>When I try to run the <code>index.js</code> file, I get the error: <code>UnhandledPromiseRejectionWarning: GraphQLError: Syntax Error: Cannot parse the unexpected character "."</code>. This seems like I'm not properly loading/using the schema file. I would like to have this working without adding more libraries, if <code>apollo-server</code> can handle this on it's own.</p>

